let anchor;
let obj;
let subLinkArray=new Array();
for(let i=0;i<menuLinks.length;i++){
    //obj.add(menuLinks[i]);
    anchor= document.createElement("a");
    obj=new Object();
    obj=menuLinks[i];
    //console.log(obj);
   
    Object.entries(obj).forEach(([key, value]) => {
        if(key=='href')
        anchor.setAttribute(key,value);
        if(key=='text')
